import{Nav, NavDropdown, NavLink} from "react-bootstrap"

const SubMenu = (props) => {
    return(
        <div>
            <Nav className="me-auto">
                <NavLink>
                    {props.title}
                    <NavDropdown>

                    </NavDropdown>
                </NavLink>
            </Nav>
        </div>
    )
}

export default SubMenu ;
